overrides:
 "dart:async":
    classes:
      Future:
         to:
           class: Future
           from: "module:typescript_dart/async"
      Stream:
         to:
           class: DartStream
           from: "module:typescript_dart/async"
 "dart:core":
    classes:
      Expando:
         operators:
           "[]" : "$get"
           "[]=" : "$set"
      List:
         to:
           class: DartList
           from: "module:typescript_dart/core"
      Map:
         to:
           class: DartMap
           from: "module:typescript_dart/core"
      Iterator:
         to:
           class: DartIterator
           from: "module:typescript_dart/core"
      Iterable:
         to:
           class: DartIterable
           from: "module:typescript_dart/core"
